function add(a,b){
    sum= a+b
    return sum
}

function sub(a,b){
    sub= a+b
    return sub
}
function multi(a,b){
    multi= a+b
    return multi
}
function div(a,b){
    div= a+b
    return div
}
export default {add,sub,multi,div}
